    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>

<body>
    <div class = "content">

<div class="addNewProjectPage hidden">
    <form id = projectCreator>
        <label for="projectName">Name Of The Project</label>
        <input type="text" class="userInput" id="projectName" required>

        <label for="projectDueDate">Due Date</label>
        <input type="date" class="userInput" id="projectDueDate">

        <label for="projectDescription">Description</label>
        <input type="text" class="userInput" id="projectDescription">

        <fieldset>
            <legend>What's the Priority?</legend>
            <input type="radio" class="userCheckbox" name="projectPriority" id="priorityOne" value="One">
            <label for="priorityOne">1</label>

            <input type="radio" class="userCheckbox" name="projectPriority" id="priorityTwo" value="Two">
            <label for="priorityTwo">2</label>

            <input type="radio" class="userCheckbox" name="projectPriority" id="priorityThree" value="Three">
            <label for="priorityThree">3</label>

            <input type="radio" class="userCheckbox" name="projectPriority" id="priorityFour" value="Four">
            <label for="priorityFour">4</label>
        </fieldset>
        <input type="submit" class="userSubmit" id="projectSubmit">
    </form>
</div>


    <div class="landingPage">
            <div class="headerContainer">
                <div class="header">
                    <div class="titleContainer">
                    <h1 class="title"> Kanari </h1>
                </div>
                    <div class="createProjectButtonContainer">
                    <input type="button" class="createNewProject" id="createNewProject" value="Create new Project?"> 
                    </div>
                </div>
            </div>
        <div class="projects" id="projects">
            <div class="projectContainer">
                <div class="projectContainerHeader">Header</div>
                <div class="projectContainerPriority"> 2</div>
                <div class="projectContainerDueDate"> 12-32-42</div>
                <div class="projectContainerDescription">Description</div>
                <input type="button" class="deleteButton">
            </div>
        </div>
        <div class="tasksPage">
        </div>
    </div>
<script defer src="main.js"></script></body>
</html>
